import React, {useEffect, useState} from 'react';
import axios from 'axios';
import Table from 'react-bootstrap/Table';

const Ventas = () => {

    const [employeesList, saveList] = useState([]);

    const listSales = () => {
        const url = "http://localhost:8080/venta/ventasPorEmpleado";
        axios.get(url)
        .then(res => saveList(res.data))
        .catch(error => console.log(error));
    }

    useEffect(()=>{
        listSales();
    },[])


    return ( 
        <React.Fragment>
            <h2>Ventas por empleado</h2>
            <Table striped bordered hover>
                <thead>
                    <tr>
                    <th>Nombre del empleado</th>
                    <th>Cantidad vendida</th>
                    </tr>
                </thead>
                <tbody>
                    {employeesList.map(employee => (
                        <tr key={employee.empleado}>
                            <td>{employee.empleado}</td>
                            <td>{employee.cantidad}</td>
                        </tr>
                    ))}
                    <tr>
                    <td>1</td>
                    <td>Mark</td>
                    <td>Otto</td>
                    <td>@mdo</td>
                    </tr>
                    <tr>
                    <td>2</td>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                    </tr>
                    <tr>
                    <td>3</td>
                    <td colSpan="2">Larry the Bird</td>
                    <td>@twitter</td>
                    </tr>
                </tbody>
            </Table>
        </React.Fragment>
     );
}

export default Ventas;
